import { useState } from 'react';


const Country = () => {
    const [country, setCountry] = useState([
        {
           City: 'Ottawa',
           Country: 'Canada'
        },
        {
            City: 'Belgrade',
            Country: 'Serbia'
        },
    ])

    const countryOutput = document.getElementById('#country');

    function pickCountry() {
        countryOutput.innerHTML = 'ok';
    }

    return (
        <>
            <p id="country"></p>
            <button id="button1" onClick={pickCountry}></button>
        </>
    )
}

export default Country;
